$(document).ready(function()
{
  var elem = document.getElementById('myCanvas');
  
  if (!elem || !elem.getContext) 
    return;
  
  // Get the canvas 2d context.
  var context = elem.getContext('2d');
  
  if (!context || !context.getImageData || !context.putImageData || !context.drawImage)
    return;
  
  var img = createImg();
  
  $("a.pixelate").click(function(e)
  {
    e.preventDefault();
                          
    pixelate(context, img, $(this).hasClass("activate") ? 10 : 1);
    $(this).toggleClass("activate");
  });
  
  img.onload = function()
  {
    pixelate(context, img, 10);
  };
});

function pixelate(context, img, blocksize)
{
  context.drawImage(img, 0, 0);
  
  width = img.width;
  height = img.height;
  
  var imageData = context.getImageData(0, 0, width , height );
  var data = imageData.data;
  
  for(var x=0; x<width; x += blocksize)
  {
    for(var y=0; y<height; y += blocksize)
    {
      // grab rgb data pixel{r,g,b,a}
      var index = (x  + y * imageData.width) * 4;
      
      var r = data[index + 0];
      var g = data[index + 1];
      var b = data[index + 2];
      
      // draw pixel block
      for(var n = 0; n < blocksize; n++) 
      {
        for(var m = 0; m < blocksize; m++) 
        {
          if(x + m < width) 
          {
            var blockIndex = ((width * (y + n)) + (x + m)) * 4;
            
            data[blockIndex + 0] = r;
            data[blockIndex + 1] = g;
            data[blockIndex + 2] = b;
          }
        }
      }
    }
  }
  
  // put pixel data on canvas
  context.putImageData(imageData, 0, 0);
};

function createImg()
{
  var img = document.createElement('img');
  img.src = "data:image/jpeg;base64,";

        return img;
      };